                                            Banking?</a>
                                        <ul class="loginfaq sidebar-list showhide-content">
                                            <li>
                                                <p>Yes. As an added measure, Online Banking gives you the capability to
                                                    easily verify that you are on the authentic Citizens website and not
                                                    on a fake site created by fraudsters. Just look for the green bar
                                                    (or some variation of it) in your browser address. The green bar
                                                    should remind you that "green is good" and that our website has
                                                    passed a sophisticated authentication process, letting you know you
                                                    are good to go.</p>
